import RDSMonitor from './components/RDSMonitor'
import './App.css';
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router>
        <Routes>
          <ul>
            <li><Link to="/account1">Account1</Link></li>
            <li><Link to="/account2">Account2</Link></li>
            <li><Link to="/account3">Account3</Link></li>
          </ul>

            <Route exact path='/account1' component={(props) => <RDSMonitor {...props} account_name="ACCOUNT1" />} />

            {/* <Route path="/account2" element={<RDSMonitor account_name="ACCOUNT2"></RDSMonitor>} />
            <Route path="/account3" element={<RDSMonitor account_name="ACCOUNT3"></RDSMonitor>} /> */}
          </Routes>
        </Router>
      </header>
    </div>
  );
}

export default App;
